import React from "react";
import { NavLink } from "react-router-dom";
import Buttons from "../buttons/Buttons";

const Nav = () => {
  const userConnected = () => {
    return true;
  };
  return (
    <nav>
      <ul>
        {userConnected ? (
          <Buttons />
        ) : (
          <li>
            <NavLink to="/">Home</NavLink>
          </li>
        )}
      </ul>
    </nav>
  );
};

export default Nav;
